import '../App.css';
import { React, useState } from 'react';
import GlobalContext from './GlobalContext';


function App() {
  const [page, setPage] = useState('start');

  return (
    <div>
      <GlobalContext.Provider value={{ page, setPage }}>
        <Page />
      </GlobalContext.Provider>
    </div>
  );
}

export default App;
